Icelandic Walk (BBC)

Travel Documentary hosted by Julia Bradbury, published by BBC in 2011 - English narration


Information
------------------------------

Julia Bradbury heads for Iceland to embark on the toughest walk of her life. Her challenge is to walk the 60 kilometres of Iceland's most famous hiking route, a trail that just happens to end at the unpronounceable volcano that brought air traffic across Europe to a standstill in 2010. With the help of Icelandic mountain guide Hanna, Julia faces daunting mountain climbs, red hot lava fields, freezing river crossings, deadly clouds of sulphuric gas, swirling ash deserts and sinister Nordic ghost stories as she attempts to reach the huge volcanic crater at the centre of the EyjafjallajÃƒÂ¶kull glacier.

